	// Use this for initialization
	void Start () {
	
		GameObject[,] maze = new GameObject[zSize,xSize];
		for (int z=0 ; z<zSize ; z++){
			for (int x=0 ; x<xSize ; x++){
				if(bluePrint[z,x] == 1)
					maze[z,x] = Instantiate(Crate, new Vector3(x*2.0f-xSize+1, 0.0f, -z*2.0f+zSize-1), Quaternion.identity) as GameObject;
					
				if(bluePrint[z,x] == 3)
					maze[z,x] = Instantiate(FireBall, new Vector3(x*2.0f-xSize+1, 0.0f, -z*2.0f+zSize-1), Quaternion.identity) as GameObject;
						
				if(bluePrint[z,x] == 2)
					maze[z,x] = Instantiate(TNT, new Vector3(x*2.0f-xSize+1, 0.0f, -z*2.0f+zSize-1), Quaternion.identity) as GameObject;

				if(bluePrint[z,x] == 4)
					maze[z,x] = Instantiate(Enemy, new Vector3(x*2.0f-xSize+1, 0.0f, -z*2.0f+zSize-1), Quaternion.identity) as GameObject;

			}
		}
	 

	}
	
